import React from 'react';
import './search-box.css';

export const SearchBox = ({placeholder,handleChange })=> {
    return(
        <div>
            <input 
              className = 'search-box'
              type='search'
              placeholder = {placeholder}
              onChange = {handleChange} 
            />
        </div>
    )
}
